// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {
    SafeERC20
} from "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import {
    ERC721Holder
} from "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";
import {Applications} from "./Applications.sol";
import {
    EnumerableSet
} from "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

// doubles as the governance contract
contract Penny is ERC20, ERC721Holder {
    using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.UintSet;

    event ApplicationReceived(uint256 applicationId, uint256 timestamp);
    event BallotCasted(address indexed voter, bool vote);

    /// @param awardToken Address of an ERC20-compatible token to award
    /// @param recipient Address to send `awardToken` to if the application is approved
    /// @param awardAmount Amount of `awardToken` to send `recipient` if the application is approved
    /// @param ipfsMetadata IPFS CID where metadata exists for this application
    struct Application {
        address awardToken;
        address recipient;
        uint256 awardAmount;
        string ipfsMetadata;
    }

    struct Vote {
        uint256 yayAmount;
        uint256 nayAmount;
        mapping(address => bool) ballots;
    }

    IERC20 private DAI;
    mapping(address => uint256) public _unlockTime;
    Applications public _applicationContract;
    EnumerableSet.UintSet private _applicationsQueue;
    mapping(uint256 => Vote) private votes;
    uint256 public voteStartTimestamp;
    address public owner;

    constructor(IERC20 _token) ERC20("Change Token", "CHANGE") {
        DAI = _token;
        owner = _msgSender();
    }

    /// @notice Deposit DAI in exchange for PNY
    /// @dev 100 PNY = 1 DAI, DAI is locked for a period of 1 year
    /// @param _amount The amount of DAI to deposit
    /// @return true on success
    function deposit(uint256 _amount) external returns (bool) {
        DAI.safeTransferFrom(_msgSender(), address(this), _amount);
        _mint(_msgSender(), _amount * 100);
        _unlockTime[_msgSender()] = block.timestamp + 15 * 60;
        return true;
    }

    /// @notice Withdraw deposited DAI after deposit lock has been removed
    /// @dev Must ensure enough DAI is held by this contract at the time of the withdrawl
    /// @return true on success
    function withdraw() external returns (bool) {
        require(block.timestamp >= _unlockTime[_msgSender()]);
        DAI.transfer(_msgSender(), ERC20.balanceOf(_msgSender())/ 100);
        _burn(_msgSender(), ERC20.balanceOf(_msgSender()));
        return true;
    }

    /// @notice Called when recieving an application
    function onERC721Received(
        address _operator,
        address _from,
        uint256 _tokenId,
        bytes memory _data
    ) public override(ERC721Holder) returns (bytes4) {
        require(_msgSender() == address(_applicationContract)); // dev: unknown ERC721 contract

        if (_applicationsQueue.length() == 0) {
            voteStartTimestamp = block.timestamp;
            _applicationsQueue.add(_tokenId);
        } else {
            _applicationsQueue.add(_tokenId);
        }

        emit ApplicationReceived(_tokenId, block.timestamp);
        return this.onERC721Received.selector;
    }

    /// @notice Getter for retrieving the currently up for vote application
    function getUpForVote() public view returns (uint256) {
        require(_applicationsQueue.length() > 0); // dev: no application up for vote
        return _applicationsQueue.at(0);
    }

    function vote(bool yayOrNay) external returns (bool) {
        require(_applicationsQueue.length() > 0); // dev: no current application up for vote
        uint256 currentApplication = getUpForVote();
        require(ERC20.balanceOf(_msgSender()) >= 0); // dev: not allowed to vote
        require(!votes[currentApplication].ballots[_msgSender()]); // dev: already voted
        require(block.timestamp < voteStartTimestamp + 30 days); // dev: vote is over

        votes[currentApplication].ballots[_msgSender()] = true;
        if (yayOrNay) {
            votes[currentApplication].yayAmount += ERC20.balanceOf(
                _msgSender()
            );
        } else {
            votes[currentApplication].nayAmount += ERC20.balanceOf(
                _msgSender()
            );
        }
        emit BallotCasted(_msgSender(), yayOrNay);
        return true;
    }

    function setApplications(Applications applicationContract) external {
        require(_msgSender() == owner);
        _applicationContract = applicationContract;
    }

    function getVotes(uint256 _application_id)
        external
        view
        returns (uint256 yayAmount, uint256 nayAmount)
    {
        yayAmount = votes[_application_id].yayAmount;
        nayAmount = votes[_application_id].nayAmount;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override(ERC20) {
        if (from != address(0) && to != address(0)) revert(); // dev: transfers are disabled
        super._beforeTokenTransfer(from, to, amount);
    }
}
